import { BrowserRouter , Routes , Route , useNavigate,Link } from 'react-router-dom';
import './TodoApp.css'
import WelcomeComponent from './WelcomeComponent';
import ErrorComponent from './ErrorComponent';
import LogoutComponent from './LogoutComponent';
import TodoComponent from './TodoComponent';
import LoginComponent from './LoginComponent';

export default  function TodoApp(){
    return(
        <>
            <BrowserRouter>
            <HeaderComponent/>
            <Routes>
            <Route path='/' element={<LoginComponent/>}/>
                <Route path='/Login' element={<LoginComponent/>}/>
                <Route path='/Welcome/:UserName' element={< WelcomeComponent/>}/>
                <Route path='/Todo' element={<TodoComponent/>}/>
                <Route path='/Logout' element={<LogoutComponent/>}/>
                <Route path='*' element={< ErrorComponent/>}/>
            </Routes>
            </BrowserRouter>    
        </>

    )
}


function HeaderComponent(){
    return(
        <header className="border-bottom border-light border-5 mb-5 p-2">
            <div className="container">
                <div className="row">
                    <nav className="navbar navbar-expand-lg">
                        <Link className="navbar-brand ms-2 fs-2 fw-bold text-black" to="#">SG</Link>
                        <div className="collapse navbar-collapse">
                            <ul className="navbar-nav">
                                <li className="nav-item fs-5"><Link className="nav-link" to="/welcome/Saksham">Home</Link></li>
                                <li className="nav-item fs-5"><Link className="nav-link" to="/Todo">Todos</Link></li>
                            </ul>
                        </div>
                        <ul className="navbar-nav">
                            <li className="nav-item fs-5"><Link className="nav-link" to="/login">Login</Link></li>
                            <li className="nav-item fs-5"><Link className="nav-link" to="/logout">Logout</Link></li>
                        </ul>
                    </nav>
                </div>
            </div>
        </header>
    )
}
function FooterComponent(){
    return(
        <footer className='footer'>
           <div className='container'>Footer</div>
        </footer>
    )
}
